content.styles:
.chat-container {
    display: grid;
    grid-template-columns: 280px 1fr;
    height: 100vh;
    font-family:
            system-ui,
            -apple-system,
            sans-serif;
}

.chat-container.dark {
    --bg-primary: #1a1a2e;
    --bg-secondary: #16213e;
    --text-primary: #eee;
    --text-secondary: #aaa;
    --border-color: #333;
    --accent: #0f4c75;
}

.chat-container.light {
    --bg-primary: #fff;
    --bg-secondary: #f5f5f5;
    --text-primary: #333;
    --text-secondary: #666;
    --border-color: #ddd;
    --accent: #3282b8;
}

.sidebar {
    background: var(--bg-secondary);
    border-right: 1px solid var(--border-color);
    display: flex;
    flex-direction: column;
    overflow: hidden;
}

.sidebar.collapsed {
    width: 60px;
}

.sidebar-header {
    padding: 1rem;
    display: flex;
    justify-content: space-between;
    align-items: center;
    border-bottom: 1px solid var(--border-color);
}

.search-container {
    padding: 0.5rem 1rem;
}

.search-container input {
    width: 100%;
    padding: 0.5rem;
    border: 1px solid var(--border-color);
    border-radius: 4px;
    background: var(--bg-primary);
    color: var(--text-primary);
}

.channel-list {
    flex: 0 0 auto;
    overflow-y: auto;
    padding: 0.5rem;
}

.channel-item {
    display: flex;
    align-items: center;
    gap: 0.5rem;
    padding: 0.5rem;
    border: none;
    background: transparent;
    color: var(--text-primary);
    width: 100%;
    text-align: left;
    border-radius: 4px;
    cursor: pointer;
}

.channel-item:hover {
    background: var(--bg-primary);
}

.channel-item.selected {
    background: var(--accent);
    color: white;
}

.channel-item.has-unread .channel-name {
    font-weight: bold;
}

.unread-badge {
    background: #e74c3c;
    color: white;
    padding: 0.125rem 0.375rem;
    border-radius: 9999px;
    font-size: 0.75rem;
    margin-left: auto;
}

.user-sections {
    flex: 1;
    overflow-y: auto;
    padding: 0.5rem;
}

.user-section h3 {
    font-size: 0.75rem;
    text-transform: uppercase;
    color: var(--text-secondary);
    padding: 0.5rem;
}

.user-list {
    list-style: none;
    padding: 0;
    margin: 0;
}

.user-item {
    display: flex;
    align-items: center;
    gap: 0.5rem;
    padding: 0.375rem 0.5rem;
    border: none;
    background: transparent;
    color: var(--text-primary);
    width: 100%;
    border-radius: 4px;
    cursor: pointer;
}

.user-item:hover {
    background: var(--bg-primary);
}

.avatar {
    width: 32px;
    height: 32px;
    border-radius: 50%;
    object-fit: cover;
}

.status-indicator {
    width: 10px;
    height: 10px;
    border-radius: 50%;
    margin-left: auto;
}

.main-content {
    display: flex;
    flex-direction: column;
    background: var(--bg-primary);
    color: var(--text-primary);
}

.channel-header {
    padding: 1rem;
    border-bottom: 1px solid var(--border-color);
}

.channel-header h1 {
    margin: 0;
    font-size: 1.25rem;
}

.channel-description {
    margin: 0.25rem 0 0;
    color: var(--text-secondary);
    font-size: 0.875rem;
}

.header-actions {
    display: flex;
    gap: 1rem;
    margin-top: 0.5rem;
    font-size: 0.875rem;
    color: var(--text-secondary);
}

.messages-container {
    flex: 1;
    overflow-y: auto;
    padding: 1rem;
}

.date-separator {
    display: flex;
    align-items: center;
    gap: 1rem;
    margin: 1rem 0;
    color: var(--text-secondary);
    font-size: 0.75rem;
}

.date-separator::before,
.date-separator::after {
    content: "";
    flex: 1;
    height: 1px;
    background: var(--border-color);
}

.message {
    display: flex;
    gap: 0.75rem;
    padding: 0.25rem 0;
}

.message.pinned {
    background: rgba(255, 215, 0, 0.1);
    padding: 0.5rem;
    border-radius: 4px;
}

.message-avatar {
    width: 40px;
    height: 40px;
    border-radius: 50%;
    object-fit: cover;
    flex-shrink: 0;
}

.avatar-placeholder {
    width: 40px;
    flex-shrink: 0;
}

.message-content {
    flex: 1;
    min-width: 0;
}

.message-header {
    display: flex;
    align-items: baseline;
    gap: 0.5rem;
    margin-bottom: 0.25rem;
}

.author-name {
    font-weight: 600;
}

.message-header time {
    color: var(--text-secondary);
    font-size: 0.75rem;
}

.edited-indicator {
    color: var(--text-secondary);
    font-size: 0.75rem;
    font-style: italic;
}

.message-text {
    margin: 0;
    word-wrap: break-word;
}

.attachments {
    display: flex;
    flex-wrap: wrap;
    gap: 0.5rem;
    margin-top: 0.5rem;
}

.attachment-image {
    max-width: 300px;
    max-height: 200px;
    border-radius: 4px;
}

.attachment-video,
.attachment-audio {
    max-width: 100%;
}

.attachment-file {
    display: flex;
    align-items: center;
    gap: 0.5rem;
    padding: 0.5rem;
    background: var(--bg-secondary);
    border-radius: 4px;
    text-decoration: none;
    color: var(--text-primary);
}

.reactions {
    display: flex;
    flex-wrap: wrap;
    gap: 0.25rem;
    margin-top: 0.5rem;
}

.reaction {
    display: flex;
    align-items: center;
    gap: 0.25rem;
    padding: 0.125rem 0.375rem;
    background: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: 9999px;
    font-size: 0.875rem;
    cursor: pointer;
}

.reaction.reacted {
    border-color: var(--accent);
    background: rgba(15, 76, 117, 0.2);
}

.thread {
    margin-top: 0.5rem;
    padding: 0.5rem;
    background: var(--bg-secondary);
    border-radius: 4px;
}

.thread summary {
    cursor: pointer;
    color: var(--accent);
    font-size: 0.875rem;
}

.thread-messages {
    margin-top: 0.5rem;
    padding-left: 0.5rem;
    border-left: 2px solid var(--border-color);
}

.reply {
    display: flex;
    align-items: center;
    gap: 0.5rem;
    padding: 0.25rem 0;
    font-size: 0.875rem;
}

.reply-avatar {
    width: 20px;
    height: 20px;
    border-radius: 50%;
}

.reply-author {
    font-weight: 600;
}

.typing-indicator {
    padding: 0.5rem;
    color: var(--text-secondary);
    font-size: 0.875rem;
    font-style: italic;
}

.message-input-container {
    padding: 1rem;
    border-top: 1px solid var(--border-color);
}

.input-wrapper {
    display: flex;
    gap: 0.5rem;
    align-items: center;
}

.input-wrapper input {
    flex: 1;
    padding: 0.75rem;
    border: 1px solid var(--border-color);
    border-radius: 4px;
    background: var(--bg-secondary);
    color: var(--text-primary);
}

.input-wrapper button {
    padding: 0.75rem 1rem;
    border: none;
    border-radius: 4px;
    background: var(--accent);
    color: white;
    cursor: pointer;
}

.input-wrapper button:disabled {
    opacity: 0.5;
    cursor: not-allowed;
}

.emoji-btn {
    background: transparent;
    border: none;
    font-size: 1.25rem;
    cursor: pointer;
}

.emoji-picker {
    position: absolute;
    bottom: 100%;
    left: 0;
    display: grid;
    grid-template-columns: repeat(6, 1fr);
    gap: 0.25rem;
    padding: 0.5rem;
    background: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: 4px;
    box-shadow: 0 2px 8px rgba(0, 0, 0, 0.2);
}

.emoji-picker button {
    padding: 0.5rem;
    border: none;
    background: transparent;
    font-size: 1.25rem;
    cursor: pointer;
    border-radius: 4px;
}

.emoji-picker button:hover {
    background: var(--bg-primary);
}

.no-channel-selected {
    flex: 1;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
    color: var(--text-secondary);
}

.no-channel-selected h2 {
    color: var(--text-primary);
}

.unread-notice {
    margin-top: 1rem;
    padding: 0.5rem 1rem;
    background: rgba(231, 76, 60, 0.2);
    border-radius: 4px;
}

.empty-state {
    padding: 1rem;
    text-align: center;
    color: var(--text-secondary);
}
